import { teamMembers } from "../../data/Constants";

const About_Team = () => {
  return (
    <section className="padding container">
      <h3 className="title-lg text-center mb-10">
        <span className="halfbg-left">آینده ی شما در دستان مطمئنی است</span>
      </h3>
      <p className="para text-center">
        با تیم کار کشته ی امپراتوری کد آشنا شو :)
      </p>
      <div className="flex mt-12">
        {teamMembers.map((item, index) => {
          return (
            <div
              className={`bg-blue-500 text-slate-50 relative${
                index == 1 ? " scale-105 z-10" : ""
              }`}
              key={index}
            >
              <div className="text-center absolute left-0 right-0">
                <h2 className="title">{item.name}</h2>
                <h4 className="tex-slate-200 font-thin">{item.role}</h4>
              </div>
              <img src={item.profile} alt={"پروفایل " + item.name} />
            </div>
          );
        })}
      </div>
    </section>
  );
};

export default About_Team;
